import numpy as np
import pandas as pd

def movingAverageInc(marketData, sampleNumber):
    marketDataFrame = pd.DataFrame(marketData)
    shape = marketDataFrame.shape
    rowsTotal, columnsTotal = shape[0], shape[1]

    temp = np.zeros(rowsTotal)

    for i in range(0, rowsTotal):
        if i < sampleNumber:
            sum = 0
            for j in range(0, i+1):
                sum += marketDataFrame["vw"][j]
            temp[i] = sum/(i+1)
        else:    
            sum = 0
            for j in range(i + 1 - sampleNumber, i + 1):
                sum += marketDataFrame["vw"][j]
            temp[i] = sum/sampleNumber
    
    num = str(sampleNumber)
    marketDataFrame["ma"+num] = temp

    return marketDataFrame

def movingAverageExc(marketData, sampleNumber):
    marketDataFrame = pd.DataFrame(marketData)
    shape = marketDataFrame.shape
    rowsTotal, columnsTotal = shape[0], shape[1]

    temp = np.zeros(rowsTotal)

    for i in range(0, rowsTotal):
        if i == 0:
            temp[i] = marketDataFrame["vw"][i]
        elif i < sampleNumber:
            sum = 0
            for j in range(0, i):
                sum += marketDataFrame["vw"][j]
            temp[i] = sum/(i)
        else:    
            sum = 0
            for j in range(i - sampleNumber, i):
                sum += marketDataFrame["vw"][j]
            temp[i] = sum/sampleNumber
    
    num = str(sampleNumber)
    marketDataFrame["ma"+num] = temp

    return marketDataFrame

